import React from 'react';

const BrowsingHistory = ({ items }) => {
  return (
    <div className="browsing-history">
      <h2>Browsing History</h2>
      <ul>
        {items.map((item, i) => (
          <li key={i}>{item.name}</li>
        ))}
      </ul>
    </div>
  );
};

export default BrowsingHistory;
